const Def = require('./default');

//create error404 stub function
function error404 () {
    return(
        // Using Def component as a wrapper
        <Def>
            <main>
                <h1>404: PAGE NOT FOUND</h1>
                <p id="errorPageText">Sorry, this page is not here. :&#40;</p>
            </main>
        </Def>
    )

}

//export error404 function
